import React from "react";
import * as io from "socket.io-client";

export default function Medium() {
	let socket = io.connect();
	socket.on("firstNumber", (msg) => console.log("msg: ", msg));
	return (
		<div>
			<h1>yo</h1>
		</div>
	);
}

